import React, { Component } from 'react';

class KonstituenCreate extends Component {
   render() {
      return (
         <div>
            <h1>Tambah Konstituen</h1>
            <form>
              <div className="form-group">
                <label>Nama</label>
                <input name="nama" className="form-control"/>
              </div>
            </form>
         </div>
      )
   }
}

export default KonstituenCreate;
